import React from 'react'
import waitForElm from '../middlewares/waitForElm'
import Aeapi from '../api/aeapi'

const Transitions = ()=>{
    return (
      <div className='transitions'>
        <button id='getTrans'>Get Transition</button>
        <table>
          <thead>
            <th>Id Khách Hàng</th>
            <th>Tên Khách Hàng</th>
            <th>Số tiền Chuyển Khoản</th>
            <th>Số tiền Chuyển Khoản</th>
          </thead>
        </table>
      </div>
    )
}

waitForElm('.transitions').then(()=>{
  document.getElementById('getTrans').addEventListener('click',()=>{
    Aeapi.transitions()
  })
})

export default Transitions;
